Wagner, Belle M - Within the Temple if Isis, 1899, 154 pages

This is an interesting fictional account of an Egyptian girl and her experiences in the temple of Isis. It deals with some unusual concepts like astral travel and soul transference. While reading this book won't teach you the secrets of the Egyptian Hierophants, it is an interesting read.


